import React from 'react';
import 'react-push-menu/styles/component.css';
import PushMenu from 'react-push-menu';
import './App.css';

function App() {
  return(
    <PushMenu
      nodes={this.state.menu}
      type={'cover'}
      propMap={{url: 'link'}}>

      <div className="rpm-trigger" id="rpm-trigger">trigger</div>

    </PushMenu>
  );
}

export default App;
